export default function Times() {
    const bookingSlots = ["06:00 - 09:00", "09:00 - 12:00", "12:00 - 15:00", "15:00 - 18:00"];
    return (
        <div>
            {bookingSlots.map(t => <button>{t}</button>)}
        </div>
    )
}
